import React, { useEffect, useState } from 'react';

const PlayerPicksPage = () => {
  const [games, setGames] = useState([]);
  const [selectedPicks, setSelectedPicks] = useState({});
  const [playerName, setPlayerName] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch('http://localhost:4000/api/games')
      .then((res) => res.json())
      .then((data) => {
        setGames(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching games:', error);
        setLoading(false);
      });
  }, []);

  const handlePick = (gameIndex, team) => {
    const newPicks = { ...selectedPicks };
    newPicks[gameIndex] = team;

    const totalPicks = Object.values(newPicks).filter(Boolean).length;
    if (totalPicks > 10) {
      alert('You can only select 10 teams total.');
      return;
    }

    setSelectedPicks(newPicks);
  };

  const handleSubmit = () => {
    if (!playerName.trim()) {
      alert('Please enter your game name.');
      return;
    }

    if (Object.keys(selectedPicks).length !== 10) {
      alert('Please select exactly 10 picks before submitting.');
      return;
    }

    const submission = {
      name: playerName,
      picks: Object.values(selectedPicks),
    };

    fetch('http://localhost:4000/api/submit-picks', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(submission),
    })
      .then((res) => {
        if (!res.ok) {
          throw new Error('Submission failed');
        }
        return res.json();
      })
      .then((data) => {
        alert(data.message);
      })
      .catch((err) => {
        console.error(err);
        alert('Something went wrong submitting your picks.');
      });
  };

  if (loading) {
    return <div style={{ padding: '1rem', fontSize: '18px' }}>Loading games...</div>;
  }

  return (
    <div style={{ padding: '1rem', fontFamily: 'Arial' }}>
      <h1 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '1rem' }}>
        Player Picks - Week 1
      </h1>

      <div style={{ marginBottom: '1rem' }}>
        <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
          Your Game Name:
        </label>
        <input
          type="text"
          value={playerName}
          onChange={(e) => setPlayerName(e.target.value)}
          style={{
            padding: '8px',
            border: '1px solid #ccc',
            borderRadius: '4px',
            width: '300px',
          }}
          placeholder="Enter your exact game name"
        />
      </div>

      <p style={{ marginBottom: '1rem' }}>
        Selected Picks: {Object.keys(selectedPicks).length} / 10
      </p>

      <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem', marginBottom: '2rem' }}>
        {games.map((game, index) => {
          const spread = parseFloat(game.spread);
          let displayText = '';

          if (spread < 0) {
            displayText = `${game.team1} (${spread}) vs ${game.team2}`;
          } else if (spread > 0) {
            displayText = `${game.team1} vs ${game.team2} (-${spread})`;
          } else {
            displayText = `${game.team1} vs ${game.team2}`;
          }

          const selected = selectedPicks[index];

          return (
            <div key={index} style={{ border: '1px solid #ccc', padding: '1rem', borderRadius: '8px' }}>
              <p style={{ fontWeight: 'bold', marginBottom: '0.5rem' }}>{displayText}</p>
              <div style={{ display: 'flex', gap: '1rem' }}>
                {[game.team1, game.team2].map((team) => (
                  <button
                    key={team}
                    onClick={() => handlePick(index, team)}
                    style={{
                      padding: '8px 16px',
                      borderRadius: '4px',
                      border: '1px solid #999',
                      backgroundColor: selected === team ? 'red' : '#eee',
                      color: selected === team ? 'white' : 'black',
                      fontWeight: selected === team ? 'bold' : 'normal',
                      cursor: 'pointer',
                    }}
                  >
                    {team}
                  </button>
                ))}
              </div>
            </div>
          );
        })}
      </div>

      <button
        onClick={handleSubmit}
        style={{
          backgroundColor: 'green',
          color: 'white',
          padding: '10px 20px',
          fontWeight: 'bold',
          borderRadius: '4px',
          border: 'none',
          cursor: 'pointer',
        }}
      >
        Submit Picks
      </button>
    </div>
  );
};

export default PlayerPicksPage;
